import React from "react";

// Ornate, white flourish with subtle pink glow for the brand
const SectionDivider = ({ className = "" }) => {
  return (
    <div className={`flex justify-center my-10 ${className}`}>
      <svg
        width="360"
        height="40"
        viewBox="0 0 360 40"
        xmlns="http://www.w3.org/2000/svg"
        aria-hidden="true"
      >
        <defs>
          <filter id="pinkGlow" x="-50%" y="-50%" width="200%" height="200%">
            <feDropShadow dx="0" dy="0" stdDeviation="3" flood-color="#F7EAF2" flood-opacity="1" />
          </filter>
        </defs>

        <g filter="url(#pinkGlow)" stroke="#FFFFFF" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" fill="none">
          {/* Left flourish */}
          <path d="M10 20 C 50 5, 90 5, 130 20" />
          <path d="M10 20 C 50 35, 90 35, 130 20" />
          <path d="M28 20 C 42 14, 58 14, 72 20 C 86 26, 102 26, 116 20" opacity="0.8" />

          {/* Right flourish (mirrored) */}
          <path d="M230 20 C 270 5, 310 5, 350 20" />
          <path d="M230 20 C 270 35, 310 35, 350 20" />
          <path d="M244 20 C 258 14, 274 14, 288 20 C 302 26, 318 26, 332 20" opacity="0.8" />

          {/* Center rosette and waves */}
          <path d="M160 20 c 10 -10 30 -10 40 0 c -10 10 -30 10 -40 0" />
          <path d="M150 20 c 15 -15 45 -15 60 0 c -15 15 -45 15 -60 0" opacity="0.8" />
          <circle cx="180" cy="20" r="3" fill="#FFFFFF" stroke="#FFFFFF" />
        </g>
      </svg>
    </div>
  );
};

export default SectionDivider;
